import React from "react";
import {Routes,Route} from 'react-router-dom';
import Map from './pages/maps/map'


const AllRoutes= ()=>{
    return(
        <Routes>
            <Route exact path ='/map' element={<Map/>}/>
        </Routes>
    )   
}
export default AllRoutes
